+ (void)drawWhatsappshareicon
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();


    //// Image Declarations
    UIImage* pathImage = [UIImage imageNamed: @"pathImage.png"];
    UIImage* groupImage2 = [UIImage imageNamed: @"groupImage2.png"];

    //// Capa 1
    {
        //// <Group> 4
        {
            //// <Path> Drawing
            UIBezierPath* pathPath = [UIBezierPath bezierPathWithRect: CGRectMake(0, 5, 949, 949)];
            CGContextSaveGState(context);
            [pathPath addClip];
            CGContextScaleCTM(context, 1.0, -1.0);
            CGContextDrawTiledImage(context, CGRectMake(0, -5, pathImage.size.width, pathImage.size.height), pathImage.CGImage);
            CGContextRestoreGState(context);


            //// <Group> 3 Drawing
            UIBezierPath* group3Path = [UIBezierPath bezierPathWithRect: CGRectMake(143, 147, 665, 665)];
            CGContextSaveGState(context);
            [group3Path addClip];
            CGContextScaleCTM(context, 1.0, -1.0);
            CGContextDrawTiledImage(context, CGRectMake(143, -147, groupImage2.size.width, groupImage2.size.height), groupImage2.CGImage);
            CGContextRestoreGState(context);
        }
    }
}

