+ (void)drawAborticon
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Group
    {
        //// Rectangle Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 301.86, 297.86);
        CGContextRotateCTM(context, 45 * M_PI / 180);

        UIBezierPath* rectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(-52.7, -368.93, 105.41, 737.86)];
        [Graphics.fillColor setFill];
        [rectanglePath fill];
        [Graphics.fillColor setStroke];
        rectanglePath.lineWidth = 4;
        [rectanglePath stroke];

        CGContextRestoreGState(context);


        //// Rectangle 2 Drawing
        CGContextSaveGState(context);
        CGContextTranslateCTM(context, 301.86, 297.86);
        CGContextRotateCTM(context, -45 * M_PI / 180);

        UIBezierPath* rectangle2Path = [UIBezierPath bezierPathWithRect: CGRectMake(-52.7, -368.93, 105.41, 737.86)];
        [Graphics.fillColor setFill];
        [rectangle2Path fill];
        [Graphics.fillColor setStroke];
        rectangle2Path.lineWidth = 4;
        [rectangle2Path stroke];

        CGContextRestoreGState(context);
    }
}

